import React from 'react';


import Container from '@material-ui/core/Container';

import PersonIcon from '@material-ui/icons/Person';
import PeopleIcon from '@material-ui/icons/People';
import ChildFriendlyIcon from '@material-ui/icons/ChildFriendly';
import EventIcon from '@material-ui/icons/Event';
import TodayIcon from '@material-ui/icons/Today';
import WbSunnyIcon from '@material-ui/icons/WbSunny';
import AcUnitIcon from '@material-ui/icons/AcUnit';

export default function Description ({tripListData})  {

  return (
    <Container maxWidth="sm" > 
        <div>For {tripListData.numberOfPeople} 
          {tripListData.numberOfPeople === "single" ? <PersonIcon /> : null }
          {tripListData.numberOfPeople === "couple" ? <PeopleIcon /> : null }
          {tripListData.numberOfPeople === "family with kids" ? <ChildFriendlyIcon /> : null }
        </div> 
        <div>During {tripListData.tripLength}
          {tripListData.tripLength === "weekend" ? <TodayIcon/>: null }
          {tripListData.tripLength === "week" ? <><TodayIcon/><EventIcon /></> : null }
        </div> 
        <div>In the {tripListData.seasonTime}
          {tripListData.seasonTime === "summer" ? <WbSunnyIcon /> : null }
          {tripListData.seasonTime === "winter" ? <AcUnitIcon /> : null }
        </div>
    </Container>
  )
  }
